    public void exhaustiveTest() {
        for (char p = 'A'; p <= 'L'; p++) {
            Piece piece = Piece.valueOf(String.valueOf(p));
            for (char c = 'A'; c <= 'G'; c++) {
                for (char r = 'A'; r <= 'C'; r++) {
                    for (char o = 'A'; o <= 'H'; o++) {
                        checkIndices(piece, c, r, o, indices[(p - 'A') * 7 * 3 * 8 + (c - 'A') * 3 * 8 + (r - 'A') * 8 + (o - 'A')]);
                    }
                }
            }
        }
    }

